export const Genres = ({ arrGenres }) => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-6">
          <div className="form-check">
            <input
              className="form-check-input"
              type="checkbox"
              value={value}
              id={id}
              onChange={onChange}
            />
            <label className="form-check-label" HTMLfor={id}>
              {name}
            </label>
          </div>
        </div>
      </div>
    </div>
  );
};

<div className="row">
  {movies.map(movie => {
    return (
      <div key={movie.id} className="col-6 mb-4">
        <MovieItem item={movie} />
      </div>
    );
  })}
</div>;
